package java_basic;

public class DoWhile {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int temp = 1;
		while(temp<10) {
			System.out.println(temp);
			temp++;
		}
		System.out.println();
		do {
			System.out.println(temp);
			temp++;
		} while (temp<10);
		
	}

}
